import React, { useState, useEffect } from 'react';
import axios from 'axios';
import "@babel/polyfill";

import apiKey from '../data/apis.json';

class ContentArtist extends React.Component {
    constructor() {
      super();
      this.state = {
        expanded: false
      }
    }

    expandedText(){
        this.setState({
            expanded: true
        }); 
    }

    render() {
        if (this.state.expanded) {
            return (<div> My extended content </div>);
        } else {
            return null;
        }
    }
  }

export default ContentArtist;
